import React, { useContext } from "react";
import { FaReact, FaPython, FaJava, FaAws } from "react-icons/fa";
import { SiSpringboot, SiJenkins, SiPostgresql, SiOpencv, SiTensorflow, SiGit, SiC } from "react-icons/si";
import { DarkModeContext } from "./DarkModeContext";

const Skills = () => {
  const { isDarkMode } = useContext(DarkModeContext);

  const skills = [
    {
      category: "Programming Languages",
      items: [
        { name: "Python", icon: <FaPython className="text-4xl text-blue-500" />, level: 90 },
        { name: "Java", icon: <FaJava className="text-4xl text-red-500" />, level: 85 },
        { name: "C Programming", icon: <SiC className="text-3xl text-blue-600" />, level: 80 },
      ],
    },
    {
      category: "Frameworks & Libraries",
      items: [
        { name: "React", icon: <FaReact className="text-4xl text-blue-400" />, level: 85 },
        { name: "Spring Boot", icon: <SiSpringboot className="text-4xl text-green-500" />, level: 80 },
        { name: "TensorFlow", icon: <SiTensorflow className="text-4xl text-orange-600" />, level: 75 },
        { name: "Git", icon: <SiGit className="text-4xl text-red-600" />, level: 90 },
      ],
    },
    {
      category: "Tools & Technologies",
      items: [
        { name: "AWS", icon: <FaAws className="text-4xl text-orange-500" />, level: 75 },
        { name: "Jenkins", icon: <SiJenkins className="text-4xl text-black-600" />, level: 70 },
        { name: "PostgreSQL", icon: <SiPostgresql className="text-4xl text-blue-600" />, level: 80 },
        { name: "OpenCV", icon: <SiOpencv className="text-4xl text-green-600" />, level: 75 },
      ],
    },
  ];

  return (
    <section
      id="skills"
      className={`py-20 ${
        isDarkMode ? "bg-gradient-to-br from-gray-900 via-gray-800 to-gray-900" : "bg-white"
      }`}
    >
      <div className="container mx-auto px-4">
        <h2 
          className={`text-4xl font-bold text-center mb-4 ${
            isDarkMode ? "text-white" : "text-gray-800"
          } code-text`}
          data-aos="fade-down"
        >
          Skills
        </h2>
        <p
          className={`text-center mb-12 ${
            isDarkMode ? "text-gray-400" : "text-gray-600"
          }`}
          data-aos="fade-up"
        >
          Technologies I work with
        </p>

        <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
          {skills.map((skill, index) => (
            <div
              key={index}
              className={`p-6 rounded-lg hover-card ${
                isDarkMode ? "bg-gray-800/50" : "bg-gray-50"
              } backdrop-blur-sm`}
              data-aos="fade-up"
              data-aos-delay={index * 200}
            >
              <h3 
                className={`text-2xl font-semibold mb-6 ${
                  isDarkMode ? "text-white" : "text-gray-800"
                } code-text`}
              >
                {skill.category}
              </h3>
              <div className="space-y-6">
                {skill.items.map((item, i) => (
                  <div key={i} className="space-y-2">
                    <div className="flex items-center justify-between">
                      <div className="flex items-center space-x-3">
                        {item.icon}
                        <span className={`text-lg ${
                          isDarkMode ? "text-gray-200" : "text-gray-700"
                        }`}>
                          {item.name}
                        </span>
                      </div>
                      <span className={`text-sm ${
                        isDarkMode ? "text-gray-400" : "text-gray-500"
                      }`}>
                        {item.level}%
                      </span>
                    </div>
                    <div className={`h-2 rounded-full ${
                      isDarkMode ? "bg-gray-700" : "bg-gray-200"
                    }`}>
                      <div
                        className={`h-full rounded-full ${
                          isDarkMode ? "bg-blue-500" : "bg-blue-600"
                        }`}
                        style={{ width: `${item.level}%` }}
                      />
                    </div>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Skills;
